import React from 'react';
import './App.css';
import {Link} from 'react-router-dom';

function Projects() {
    return ( 
        <div>
           <Link to='/https://github.com/Chittoji-Murali-Sree-Krishna' target='/products'>
               <h1>My Github</h1>
           </Link>
         </div>
    );
}

export default Projects;
